triggerer.IfStat( is_hidden_monster, 0,
{
	IfStat( is_totem_object, 0,
	{
		If( this.dont_dupe != 1,
		{
			this.dont_dupe = 1;
			this.clone = CreateClone( this, copy_mods:true, disable_drops:false );
			this.clone.dont_dupe = 1;
			this.clone.SetLocation( FindRandomLocationNearLocation( 5, 25, this.GetLocation() ) );
			this.clone.AddStat( dropped_items_are_duplicated, 1 );
			this.clone.AddMonsterExplicitMod( MonsterTagMirrored );
			this.clone.PlayEffect( LakeKalandraDuplicateSpawnIn );
		} );
	} );
} );
